/*Table structure for table `srctodes` */

DROP TABLE IF EXISTS `srctodes`;

CREATE TABLE `srctodes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `pname` varchar(100) DEFAULT NULL,
  `snm` varchar(100) DEFAULT NULL,
  `skm` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `srctodes` */

insert  into `srctodes`(`id`,`pname`,`snm`,`skm`) values (1,'Shimla','Mumbai','1716.5'),(2,'Agra','Mumbai','1350'),(3,'Agra','Pune','1650'),(4,'Agra','Banglore','2150'),(5,'Shimla','Delhi','889');

/*Table structure for table `vehicle` */

DROP TABLE IF EXISTS `vehicle`;

CREATE TABLE `vehicle` (
  `id` int NOT NULL AUTO_INCREMENT,
  `cnm` varchar(100) DEFAULT NULL,
  `acnonac` varchar(100) DEFAULT NULL,
  `vtype` varchar(100) DEFAULT NULL,
  `dname` varchar(100) DEFAULT NULL,
  `dcno` varchar(100) DEFAULT NULL,
  `kmrate` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `vehicle` */

insert  into `vehicle`(`id`,`cnm`,`acnonac`,`vtype`,`dname`,`dcno`,`kmrate`) values (1,'Swift','AC','4-Seater','Raghu','1234567890','10'),(2,'Inova','AC','7-Seater','Nilesh','1234567890','15'),(3,'Ertiga','AC','7-Seater','Nilesh','1234567890','13');

/*Table structure for table `vehiclebooking` */

DROP TABLE IF EXISTS `vehiclebooking`;

CREATE TABLE `vehiclebooking` (
  `bid` int NOT NULL AUTO_INCREMENT,
  `ufullnm` varchar(100) DEFAULT NULL,
  `contno` varchar(100) DEFAULT NULL,
  `umailid` varchar(100) DEFAULT NULL,
  `source` varchar(100) DEFAULT NULL,
  `destination` varchar(100) DEFAULT NULL,
  `cname` varchar(100) DEFAULT NULL,
  `acnonac` varchar(100) DEFAULT NULL,
  `vtype` varchar(100) DEFAULT NULL,
  `drivname` varchar(100) DEFAULT NULL,
  `drivcontno` varchar(100) DEFAULT NULL,
  `km` varchar(100) DEFAULT NULL,
  `basef` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`bid`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `vehiclebooking` */

